import './HexaOptions.scss'

export default function HexaOptions(props) {

    const style = {
        $colors:props.color
    }
    
    return (
        <>
            <div className="HexaOptions" style={{'background-color':'yellow'}}>
                <div className="frame">
                    <div>
                        {props.children}
                    </div>
                </div>
            </div>
        </>
    )
}
